  false,\n\t\"url\": null,\n\t\"notes\": \"This narrative report for Montana Easements
  outlines Refuge accomplishments from January through April of 1943. The report begins
  by summarizing the weather conditions, water conditions, and food and cover during
  this period. Wildlife- including migratory birds, upland game birds, big game animals,
  furbearers, predators, rodents, and fish- is also covered. Resource management is
  outlined; topics include grazing. The public relations section of the report describes
  Refuge participation and fishing. Items of interest, N-R forms, and photographs
  are attached.\",\n\t\"owner_org\": \"4d7ad1cd-3641-420b-8116-e4082f49cd44\",\n\t\"extras\":
